import { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  // Load dark mode from localStorage
  useEffect(() => {
    const savedTheme = localStorage.getItem("theme");
    if (savedTheme === "dark") {
      document.documentElement.classList.add("dark");
      setDarkMode(true);
    }
  }, []);

  // Toggle menu
  const toggleMenu = () => setIsOpen(!isOpen);

  // Toggle dark mode
  const toggleDarkMode = () => {
    if (darkMode) {
      document.documentElement.classList.remove("dark");
      localStorage.setItem("theme", "light");
    } else {
      document.documentElement.classList.add("dark");
      localStorage.setItem("theme", "dark");
    }
    setDarkMode(!darkMode);
  };

  return (
    <nav className="bg-white dark:bg-gray-900 shadow-md px-4 py-3 sticky top-0 z-50 transition-colors">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold text-blue-600 dark:text-blue-400">
          V Recharge Hub
        </Link>

        <ul className="hidden md:flex space-x-6 items-center text-gray-700 dark:text-gray-200 font-medium">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/contact">Contact</Link></li>
          <li><Link to="/how-it-works">How It Works</Link></li>
          <li><Link to="/faq">FAQ</Link></li>

          <li className="relative group">
            <span className="cursor-pointer">Login</span>
            <ul className="absolute left-0 mt-2 w-32 bg-white dark:bg-gray-800 border dark:border-gray-700 rounded shadow-md opacity-0 group-hover:opacity-100 transition-opacity duration-200">
              <li><Link to="/login/admin" className="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-700">Admin</Link></li>
              <li><Link to="/login/user" className="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-700">User</Link></li>
            </ul>
          </li>

          <li>
            <button
              onClick={toggleDarkMode}
              className="ml-3 text-sm bg-gray-200 dark:bg-gray-700 px-3 py-1 rounded"
            >
              {darkMode ? "‚òÄÔ∏è Light" : "üåô Dark"}
            </button>
          </li>
        </ul>

        {/* Mobile Menu Button */}
        <button onClick={toggleMenu} className="md:hidden focus:outline-none text-gray-700 dark:text-gray-200">
          <svg className="w-6 h-6" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24">
            {isOpen ? (
              <path strokeLinecap="round" strokeLinejoin="round" d="M6 18L18 6M6 6l12 12" />
            ) : (
              <path strokeLinecap="round" strokeLinejoin="round" d="M4 6h16M4 12h16M4 18h16" />
            )}
          </svg>
        </button>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <ul className="md:hidden mt-3 space-y-2 bg-white dark:bg-gray-900 border-t pt-3 text-gray-700 dark:text-gray-200 font-medium">
          <li><Link to="/" onClick={toggleMenu}>Home</Link></li>
          <li><Link to="/about" onClick={toggleMenu}>About</Link></li>
          <li><Link to="/contact" onClick={toggleMenu}>Contact</Link></li>
          <li><Link to="/how-it-works" onClick={toggleMenu}>How It Works</Link></li>
          <li><Link to="/faq" onClick={toggleMenu}>FAQ</Link></li>
          <li className="pl-4 text-sm">Login</li>
          <ul className="pl-6 space-y-1">
            <li><Link to="/login/admin" onClick={toggleMenu}>Admin</Link></li>
            <li><Link to="/login/user" onClick={toggleMenu}>User</Link></li>
          </ul>
          <li className="pl-4 pt-2">
            <button
              onClick={toggleDarkMode}
              className="text-sm bg-gray-200 dark:bg-gray-700 px-3 py-1 rounded"
            >
              {darkMode ? "‚òÄÔ∏è Light" : "üåô Dark"}
            </button>
          </li>
        </ul>
      )}
    </nav>
  );
};

export default Navbar;
